import React from 'react';

const Search = (props) =>{
  return (
    <>
    <div className="search-box">
      <input
        type='text'
        placeholder='search...'
        onKeyPress={props.searchEvent}
      />
        {
          props.searchs && 
            (
              <ul>
                {
              props.searchs.map((search, i) =>(
            <li key={i}>search.title</li>

              )
              )}
              </ul>
            )
        }
      </div>
    </>
  );
};

export default Search;
